import React from 'react';

export default function About() {
  return (
    <div class="body">
      <div class="jumbotron">
        <div id="about-me-image">
          <img src="https://raw.githubusercontent.com/shannonjburris/react-portfolio/main/Assets/Images/hero.png" alt="me" />
        </div>
      </div>
      <hr class="my-4" />
      <div class="container">
        <p>I am a full-stack web developer utilizing a background in education to provide a scaffolded and clean approach from development to deployment. I earned a certificate in Full Stack Web Development from the University of Central Florida Coding Boot Camp which honed my skills as a creative problem-solver who is passionate about developing apps with a focus on user experience and accessibility. My unique background in education and music production make me a strong developer with a vision and drive for the end product.
</p>
      </div>
    </div>
  );
}
